import React from 'react'
import Card from './Card' 
import Fdata from './Fdata'

const Features = () => {
  return (
    <div>
      {
        Fdata.map((val, ind)=>{
          return <Card key={index} imgsrc={val.imgsrc} title={val.title} />
        })
      }
      
    </div>
  )
}

export default Features
